import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be rendered by JavaScript
    await page.waitForSelector('.product-card .product-price', { timeout: 5000 });

    // Take a screenshot of the rendered products
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_rendered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_rendered.png'));

    // Locate all product price elements
    const priceLocators = page.locator('.product-price');

    // Extract and parse the prices
    const prices = await priceLocators.evaluateAll(elements => {
      return elements.map(el => {
        // The price is the first text node in the div, before the <span>
        const priceText = el.firstChild.textContent.trim();
        // Remove the '$' and convert to a number
        return parseFloat(priceText.replace('$', ''));
      });
    });

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
